// Set the following variables with the name of your import set table and task id column (to be changed to use properties)  
// var importSetTableName = gs.getProperty('Record_Producer_ImportSetTable_Company');  
var company_importSetTableName = "x_133853_customer_record_producer_importsettable_company";
var costcenter_importSetTableName = "x_133853_customer_record_producer_importsettable_costcenter";
var department_importSetTableName = "x_133853_customer_record_producer_importsettable_department";
var group_importSetTableName = "x_133853_customer_record_producer_importsettable_group";
var location_importSetTableName = "x_133853_customer_record_producer_importsettable_location";
var user_importSetTableName = "x_133853_customer_record_producer_importsettable_user";
