//var importSetTaskIDFieldName = "task_id";   
// var transformMapID = gs.getProperty('TransformMap_SysID_Company');
var company_transformMapID = "fe0be933db2f030043055740cf9619dc";
var costcenter_transformMapID = "5f8a680cdb00130043055740cf961961";
var department_transformMapID = "c1bedc04db00130043055740cf9619c6";
var group_transformMapID = "df4eed14db00130043055740cf961933";
var location_transformMapID = "fbe7cd88db40130043055740cf9619d1";
var user_transformMapID = "135157a0db40130043055740cf9619c6";
var usertogroup_transformMapID = "7f9485a4db50130043055740cf961968";

var tools = new global.ScopedTools();

//
// [Company] Setup data source for attachment
//
gs.info("[Customer Onboarding][RP][Foundation] Company - Setup data source with Attachment settings");
current.name = "Customer Onboarding - Bulk Company load";  
current.import_set_table_name = company_importSetTableName;  
current.file_retrieval_method = "Attachment";  
current.type = "File";  
current.format = "Excel";  
current.header_row = 11;  
current.sheet_number = 3;  
current.insert(); 

var company_importSetRec = tools.Process_Attachment(current);
gs.info("[Customer Onboarding][RP][Foundation] Company Data Source and Import Set Configured.");
gs.addInfoMessage("Company Data Source and Import Set Configured.");

if (company_importSetRec.isValidRecord() == true){
	// Run transform for built import set using predefined transform map 
	tools.Transform(company_importSetRec.sys_id, company_transformMapID);
	gs.addInfoMessage("Company Transform Started.");
} else {
	// Something went wrong, we need to abort
	gs.addErrorMessage("Error: A Company import set was not created. Please review the Application logs for further information.");
	current.setAbortAction(true);
}

//
// [Location] Setup data source for attachment
//
gs.info("[Customer Onboarding][RP][Foundation] Begin Location Data Source and Import Set config.");
