gr.initialize();
gr.name = "Customer Onboarding - Bulk Location load";
gr.import_set_table_name = location_importSetTableName;
gr.file_retrieval_method = "Attachment";
gr.type = "File";
gr.format = "Excel";
gr.header_row = 11;
gr.sheet_number = 4;
var sys_id = gr.insert(); 

var copyAtt = new GlideSysAttachment();
copyAtt.copy('sys_data_source',current.sys_id,'sys_data_source',sys_id);

var location_importSetRec = tools.Process_Attachment(gr);
gs.info("[Customer Onboarding][RP][Foundation] Location Data Source and Import Set Configured.");
gs.addInfoMessage("Location Data Source and Import Set Configured.");

if (location_importSetRec.isValidRecord() == true){
